INSERT INTO `aggregator_item` VALUES (1760,2,'Running The Ladder – Baseball Conditioning Drills','http://www.baseball-tutorials.com/running-the-ladder-baseball-conditioning-drills/1774/','kenny','<div id=\"attachment_1775\" class=\"wp-caption alignright\" style=\"width: 310px\"><a href=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Running-Grid-One-Foot-In-One-Hole.png\"><img class=\"size-medium wp-image-1775\" title=\"Baseball Drills\" src=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Running-Grid-One-Foot-In-One-Hole-300x225.png\" alt=\"Baseball Conditioning Drills\" width=\"300\" height=\"225\" /></a><p class=\"wp-caption-text\">One Foot in One Hole</p></div>\n<p>Using the running ladder is a great way to improve everything from <a title=\"Baseball Conditioning Drills – The Magic Medicine Ball\" href=\"http://www.baseball-tutorials.com/baseball-conditioning-drills-the-magic-medicine-ball/1640/\">conditioning</a>, to <a title=\"Baserunning Drills – Buidling Core and Leg Strength\" href=\"http://www.baseball-tutorials.com/baserunning-drills-buidling-core-and-leg-strength/1603/\">speed</a>, to <a title=\"Baseball Conditioning Drills – Building Speed and Quickness\" href=\"http://www.baseball-tutorials.com/baseball-conditioning-drills-building-speed-and-quickness/1586/\">quickness</a>, coordination, it covers it all &#8211; that&#8217;s why it&#8217;s a must have for my baseball practices. There are a huge variety of drills that you can run through, and coaches are always coming to me with their new and innovative ways of using the ladder, so if you&#8217;ve got any you love, make sure you let us know in the comments section below!</p>\n<p>The running ladder, if you&#8217;re not familiar, is a flat rope ladder that you throw down on the ground. Next, you have your players line up at one end of the ladder, and</p>\n<div id=\"attachment_1776\" class=\"wp-caption alignleft\" style=\"width: 310px\"><a href=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Running-Grid-Two-Feet-In-One-Hole.png\"><img class=\"size-medium wp-image-1776\" title=\"Baseball Drills\" src=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Running-Grid-Two-Feet-In-One-Hole-300x223.png\" alt=\"Baseball Coaching\" width=\"300\" height=\"223\" /></a><p class=\"wp-caption-text\">Two Feet in One Hole</p></div>\n<p>then you let them loose!</p>\n<h3>One Foot in One Hole</h3>\n<p>To start, give them an easy one, and progressively make them slightly more difficult. This first technique is simple, have them run through, staying on one side, and touching down one foot in each hole as they run through. Have them jog through the first couple times to get used to it, and once they have the technique down, have them compete! See who can get through the fastest without</p>\n<div id=\"attachment_1777\" class=\"wp-caption alignright\" style=\"width: 310px\"><a href=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Running-Grid-Alternating-Sides.png\"><img class=\"size-medium wp-image-1777 \" title=\"Baseball Conditioning Drills\" src=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Running-Grid-Alternating-Sides-300x224.png\" alt=\"Baseball Baserunning Drills\" width=\"300\" height=\"224\" /></a><p class=\"wp-caption-text\">Alternating Sides</p></div>\n<p>stepping out of bounds!</p>\n<h3>Two Feet In One Hole</h3>\n<p>This one is a little bit tougher. They have to really work their feet up and down here &#8211; they&#8217;re going to be putting both feet down in each hole before progressing to the next. Same as before &#8211; start off slow, and then make it competitive!</p>\n<div id=\"attachment_1778\" class=\"wp-caption alignleft\" style=\"width: 310px\"><a href=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Running-Grid-Duck-Walk.png\"><img class=\"size-medium wp-image-1778\" title=\"Baseball Fielding Drills\" src=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Running-Grid-Duck-Walk-300x224.png\" alt=\"Baseball Defensive Drills\" width=\"300\" height=\"224\" /></a><p class=\"wp-caption-text\">Duck Walk</p></div>\n<h3>Alternating Sides</h3>\n<p>Once they&#8217;ve gotten running through on one side down pat, have them run through, putting one foot on the right side, and the next on the left, alternating back and forth through the entire ladder!</p>\n<h3>Duck Walk</h3>\n<p>Now it&#8217;s time to test their coordination! In the duck walk you&#8217;re alternating sides &#8211; but instead of putting your left foot on the left side, they&#8217;re going to put their</p>\n<div id=\"attachment_1779\" class=\"wp-caption alignright\" style=\"width: 310px\"><a href=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Running-Grid-Duck-Run.png\"><img class=\"size-medium wp-image-1779\" title=\"Baseball Drills\" src=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Running-Grid-Duck-Run-300x223.png\" alt=\"Youth Baseball Coaching\" width=\"300\" height=\"223\" /></a><p class=\"wp-caption-text\">Duck Run</p></div>\n<p>opposite foot. This forces them to rotate their body and concentrate just a little bit harder. Your players still will probably think this is easy, until they have to try out the &#8230;</p>\n<h3>Duck Run</h3>\n<p>The same idea as the Duck Walk, except they&#8217;re going to be doing it at a full speed! This one is pretty tough &#8211; challenge your players to see who can figure out the rhythm!</p>\n<p>&nbsp;</p>\n<p>Now that your all warmed up, why don&#8217;t you take a look at some of <a href=\"http://www.baseball-tutorials.com/dir/drills/bassrunning/\">my favorite baserunning drills</a>! And don&#8217;t forget to check in at the <a href=\"http://www.facebook.com/BaseballDrills\">Baseball Tutorials Facebook page!</a></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>',1342438457,'http://www.baseball-tutorials.com/?p=1774'),(1761,2,'Pitch Like A Pro – The Biggest Secret Behind The ChangeUp','http://www.baseball-tutorials.com/pitch-like-a-pro-changeup/1784/','kenny','<p>There are a few grips that almost everyone has in their arsenal, like the fast ball and the curve ball for example. But throwing those same two pitches all the time, even if they&#8217;re great, will allow the batter to load up and <a title=\"Batting Tips – Strong Stance, Strong Hitter\" href=\"http://www.baseball-tutorials.com/batting-stance-tips/1765/\">knock it out of the park</a> &#8211; we&#8217;ve got to make the batter stay back, wait, and see what pitch is thrown, instead of just being able to anticipate it. That&#8217;s why teaching your players pitches with dynamic, unpredictable movement will make them better pitchers than they could ever be with just two classic pitches up their sleeve.</p>\n<p>There are a couple less frequently used grips that you start to see more and more as you get into higher levels of competition. They&#8217;re great to practice, and they can be tough to master, but I always have my players give them a shot &#8211; one of them might be their money pitch and they don&#8217;t even know it yet!</p>\n<div id=\"attachment_1785\" class=\"wp-caption aligncenter\" style=\"width: 310px\"><a href=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Changeup-Grip.png\"><img class=\"size-medium wp-image-1785\" title=\"Baseball Pitching Drills\" src=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Changeup-Grip-300x224.png\" alt=\"Baseball Drills\" width=\"300\" height=\"224\" /></a><p class=\"wp-caption-text\">Circle Changeup Grip</p></div>\n<h3>Circle Changeup Grip</h3>\n<p>So here&#8217;s the grip for the circle changeup.  Were going to put the ball a little deeper in the palm than what were used to, creating a circle around the ball with our hand. When you throws this change-up, the mechanics are basically the same as a normal fast ball &#8211; your just going to take tad longer stride and drag the back foot a little bit.  That&#8217;s going to enable our pitcher to slow the arm down and make the pitch die at the plate.</p>\n<div id=\"attachment_1786\" class=\"wp-caption aligncenter\" style=\"width: 310px\"><a href=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Changeup-Grip-2.png\"><img class=\"size-medium wp-image-1786\" title=\"Baseball Pitching Drills\" src=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Changeup-Grip-2-300x224.png\" alt=\"Baseball coaching\" width=\"300\" height=\"224\" /></a><p class=\"wp-caption-text\">2 Finger Choke Grip</p></div>\n<h3>Two Finger Choke Changeup Grip</h3>\n<p>This is a very similar pitch, with the exact same throwing mechanics as the circle changeup, and an almost identical grip. Here though, were going to release our grip with the pinky and ring fingers, keeping the ball deep in our palmm with just the middle and index fingers, as well as the thumb.</p>\n<p>You don&#8217;t need to have all three of these pitches in your arsenal, but having just one can do a great deal for your pitching game and in making sure the batter doesn&#8217;t know what&#8217;s about to hit him.</p>\n<div id=\"attachment_1787\" class=\"wp-caption aligncenter\" style=\"width: 310px\"><a href=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Changeup.png\"><img class=\"size-medium wp-image-1787\" title=\"Baseball Drills\" src=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Changeup-300x223.png\" alt=\"Baseball Defensive Drills\" width=\"300\" height=\"223\" /></a><p class=\"wp-caption-text\">Changeup Throw Technique</p></div>\n<p>If you&#8217;re looking for more help with your pitching game, make sure to check out our entire archive of <a href=\"http://www.baseball-tutorials.com/dir/drills/pitching/\">baseball pitching drills</a>, and make sure to leave any questions or comments below!</p>\n<p>&nbsp;</p>',1342562244,'http://www.baseball-tutorials.com/?p=1784'),(1762,2,'The Bent Leg Slide and All of its Secrets – Exposed!','http://www.baseball-tutorials.com/bent-leg-slide/1789/','kenny','<p><a href=\"http://www.baseball-tutorials.com/bent-leg-slide/1789/\"><em>Click here to view the embedded video.</em></a></p>\n<p>Well I have to tell you up front &#8211; they won&#8217;t all be <em>that</em> spectacular. The sliding catch is one of baseball&#8217;s most impressive plays, and while here we see an (unbelievable) over the shoulder sliding catch, today were going to have a look at a more traditional technique.</p>\n<p>Whether it&#8217;s because the fielder judged the ball badly or just was too far out of position to get right underneath the ball, sometimes you have to reach for your ace in the hole and just go for it.</p>\n<div id=\"attachment_1792\" class=\"wp-caption aligncenter\" style=\"width: 310px\"><a href=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Bent-Leg-Slide-Drill.png\"><img class=\"size-medium wp-image-1792\" title=\"Fun Baseball Drills\" src=\"http://www.baseball-tutorials.com/wp-content/uploads/2012/07/Bent-Leg-Slide-Drill-300x223.png\" alt=\"Baseball Fielding Drills\" width=\"300\" height=\"223\" /></a><p class=\"wp-caption-text\">Bent Leg Slide Drill</p></div>\n<h3>Bent Leg Slide Drill</h3>\n<p>This is a great drill to do right at the end of practice &#8211; the players are going to get dirty, and they&#8217;re going to have a ball doing it! But to make it a little more enjoyable, make sure you do it on a surface that&#8217;s not going to tear them up.  Nice tall grass in the outfield with a pair of sweats that mom doesn&#8217;t care if they get grass stained &#8211; or you can do it on the infield surface so it doesn&#8217;t tear up their legs and it doesn&#8217;t tear up their uniforms and things like that.</p>\n<p>It&#8217;s an invaluable skill because you&#8217;ll have somebody in the outfield virtually on a daily or by game basis that&#8217;ll be into a bent leg slide.  If they know how to do it, they&#8217;re going to avoid getting themselves injured, number one.  Number two, they&#8217;re going to have a great chance of catching the ball.</p>\n<p>The technique is fairly simple, it&#8217;s a slide just as if you&#8217;re going to slide into second base or third base, except you&#8217;re going to extend your hand.  So when the guys go out there and do it, you&#8217;re going to notice them working on a regular slide.  I put them about 25&#8242; away from me, I&#8217;ll yell go, flip the ball, and they&#8217;ll go into a slide.</p>\n<p>After they get in the reps and they get comfortable with it and then consequently when game time comes and the ball gets hit like that, they already know how to do it and they go right into it.</p>\n<p>And if you need some more help for your outfield, check out this great post on <a title=\"Baseball Fielding Drills – Working the Fence\" href=\"http://www.baseball-tutorials.com/baseball-fielding-drills-working-the-fence/1728/\">how to work the fence properly</a>, and make sure to check out our<a href=\"http://www.facebook.com/BaseballDrills\"> Facebook page</a> for daily updates!</p>',1343038800,'http://www.baseball-tutorials.com/?p=1789'),(1763,2,'The Three Biggest Pitcher Mistakes – And How To Fix Them','http://www.baseball-tutorials.com/the-three-biggest-pitcher-mistakes-and-how-to-fix-them/1803/','kenny','<p>The set position is absolutely key to the success of any pitcher, from little league all the way up to the majors. It’s the catalyst for everything else the pitcher does, whether that’s flinging a fastball at home or trying to pick off a runner at third. There are several common mistakes that you’ll see [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/the-three-biggest-pitcher-mistakes-and-how-to-fix-them/1803/\">The Three Biggest Pitcher Mistakes &#8211; And How To Fix Them</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Drills | Youth Baseball Coaching Tips</a>.</p>',1343654779,'http://www.baseball-tutorials.com/?p=1803'),(1764,2,'Ready, Set, Pitch! How To Control The Infield From the Set Position','http://www.baseball-tutorials.com/ready-set-pitch-how-to-control-the-infield-from-the-set-position/1808/','kenny','<p>The thing that I like to stress more than anything is that let&#8217;s help these young guys be ready for their transition as they get older.  If he learns how to do this now, then when he turns 13, he will be one of the leaders that can go out and do this the way [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/ready-set-pitch-how-to-control-the-infield-from-the-set-position/1808/\">Ready, Set, Pitch! How To Control The Infield From the Set Position</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Drills | Youth Baseball Coaching Tips</a>.</p>',1343655741,'http://www.baseball-tutorials.com/?p=1808'),(1765,2,'Dancing At The Mound – The Waltz Drill','http://www.baseball-tutorials.com/pitching-drills-waltz/1817/','kenny','<p>As a pitcher, spending as much time as possible perfecting your craft is the only way to get an edge on the batters you’ll be seeing game in and game out. But there’s only so many hours a week your team can practice, or you’re on your own and you’ve only got one ball, or [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/pitching-drills-waltz/1817/\">Dancing At The Mound &#8211; The Waltz Drill</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Drills | Youth Baseball Coaching Tips</a>.</p>',1344265248,'http://www.baseball-tutorials.com/?p=1817'),(1766,2,'One Adjustment To Make Any Pitching Drill Easy On Your Arm','http://www.baseball-tutorials.com/towel-drill-pitching-tips/1823/','kenny','<p>Pitchers pitch. It’s what they do. Some of them pitch until their arms fall off! And that’s the thing – there’s only so many pitches you can throw a day before you’ll wear your arm out. So that’s why one of the best ways to separate yourself from other pitchers is finding ways to improve [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/towel-drill-pitching-tips/1823/\">One Adjustment To Make Any Pitching Drill Easy On Your Arm</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Drills | Youth Baseball Coaching Tips</a>.</p>',1344275885,'http://www.baseball-tutorials.com/?p=1823'),(1767,2,'1 Brutal Pitching Mistake (That’s Easy To Fix)','http://www.baseball-tutorials.com/pitchingdrill/1830/','kenny','<p>There&#8217;s one big mistake that I see LOADS of pitchers making &#8211; from 8 year olds to 18 year olds. Rushing. Going to quickly through the approach and delivery phases can throw your pitcher off his alignment and make it WAY harder to hit his spots. Fortunately &#8211; there&#8217;s a pretty easy fix. It&#8217;s called [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/pitchingdrill/1830/\">1 Brutal Pitching Mistake (That&#8217;s Easy To Fix)</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Drills | Youth Baseball Coaching Tips</a>.</p>',1344277782,'http://www.baseball-tutorials.com/?p=1830'),(1768,2,'The DiMaggio Drop Step – Outfield Footwork Tips','http://www.baseball-tutorials.com/outfield-footwork-drills/1836/','kenny','<p>Oftentimes in the outfield, that one extra inch can make all the difference between an out and a base hit. And learning how to minimize any extra movement, being as efficient as possible with every step, is the best way to make sure that you don&#8217;t waste a second. That&#8217;s where this outfield movement drill comes [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/outfield-footwork-drills/1836/\">The DiMaggio Drop Step &#8211; Outfield Footwork Tips</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Drills | Youth Baseball Coaching Tips</a>.</p>',1344795244,'http://www.baseball-tutorials.com/?p=1836'),(1769,2,'Grabbing the Grounder – 3 Effective Fielding Techniques','http://www.baseball-tutorials.com/fielding-groundball-technique/1843/','kenny','<p>Dealing with a ground ball can be tricky &#8211; you never know exactly how they&#8217;ll come off the next hop. So learning a variety of ways to scoop them up gives you the best chance of being able to handle every situation that comes up. There are three ways I teach my players, from safest [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/fielding-groundball-technique/1843/\">Grabbing the Grounder &#8211; 3 Effective Fielding Techniques</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Drills | Youth Baseball Coaching Tips</a>.</p>',1344873212,'http://www.baseball-tutorials.com/?p=1843'),(1770,2,'Baseball Training Workout: Running Faster','http://www.baseball-tutorials.com/baseball-training-workout/1852/','kenny','<p>This baseball training workout was designed for players ranging from the professional ranks all the way down to the junior league. It&#8217;s a workout designed systematically to make your players faster, quicker, and more active on the baseball field&#8211;all the factors that are necessary to be an outstanding baseball player.  This workout will help your [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/baseball-training-workout/1852/\">Baseball Training Workout: Running Faster</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Drills | Youth Baseball Coaching Tips</a>.</p>',1346262824,'http://www.baseball-tutorials.com/?p=1852'),(1771,2,'Baseball Practice: Warming Up and Getting Mechanical','http://www.baseball-tutorials.com/baseball-practice-warming-up/1860/','kenny','<p>Baseball practice is the perfect time to get your pitcher and other players warmed up and ready to condition the arm for more successful pitches and throws. Today we&#8217;ll be dealing with stretches and a mechanical pitching drill to help you throw the baseball consistently for strikes and help you take less wear and tear [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/baseball-practice-warming-up/1860/\">Baseball Practice: Warming Up and Getting Mechanical</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Drills | Youth Baseball Coaching Tips</a>.</p>',1346682631,'http://www.baseball-tutorials.com/?p=1860'),(1772,2,'Baseball Hitting Practice: Focusing on the Body’s Various Systems','http://www.baseball-tutorials.com/baseball-practice-bodys-systems/1866/','kenny','<p>Before you ever jump into hitting drills during baseball practice, it&#8217;s essential to spend some time focusing on the body&#8217;s various systems that are used day in and day out on the field. Talking About Visual Cues, Field of Vision, and Depth Perception During Baseball Practice To start off, we&#8217;re going to talk about visual [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/baseball-practice-bodys-systems/1866/\">Baseball Hitting Practice: Focusing on the Body&#8217;s Various Systems</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Drills | Youth Baseball Coaching Tips</a>.</p>',1346869137,'http://www.baseball-tutorials.com/?p=1866'),(1773,2,'Baseball Practice: Working with Your Pitcher','http://www.baseball-tutorials.com/baseball-practice-working-with-pitcher/1875/','kenny','<p>Today, we&#8217;re going to focus on some technicalities when it comes to working with your pitcher during baseball practice. Read on to find out specific things to talk to your pitcher about that will help him improve his game. Going Over Your Pitcher&#8217;s Positioning During Baseball Practice The first thing we want to cover is [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/baseball-practice-working-with-pitcher/1875/\">Baseball Practice: Working with Your Pitcher</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Drills | Youth Baseball Coaching Tips</a>.</p>',1347466579,'http://www.baseball-tutorials.com/?p=1875'),(1774,2,'Kids Baseball Drills to Get Explosive Speed','http://www.baseball-tutorials.com/kids-baseball-drills-speed/1881/','kenny','<p>We want to share with you some kids baseball drills that are going to help make your baseball players better athletes. Successful athletes need great speed, quickness, explosiveness, and balance&#8211;all these basic athletic skills maximize potential during a baseball game. Linear and Lateral Jump and Stick Drill Here we&#8217;re working on balance and stability of [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/kids-baseball-drills-speed/1881/\">Kids Baseball Drills to Get Explosive Speed</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Drills | Youth Baseball Coaching Tips</a>.</p>',1347907035,'http://www.baseball-tutorials.com/?p=1881'),(1775,2,'Baseball Drills Focusing on Hitting with Speed and Power','http://www.baseball-tutorials.com/baseball-drills-hitting/1887/','kenny','<p>Welcome to our hitting workout complete with baseball drills, fundamentals, and techniques that you need to become a better hitter in a ballgame. Bat Behind the Back Baseball Drill Hitting begins below the waist, and if we can get our lower half started and keep our upper body intact, we&#8217;ve got a great chance not [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/baseball-drills-hitting/1887/\">Baseball Drills Focusing on Hitting with Speed and Power</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Drills | Youth Baseball Coaching Tips</a>.</p>',1348060989,'http://www.baseball-tutorials.com/?p=1887'),(1776,2,'How to Increase Your Players’ Speed and Power','http://www.baseball-tutorials.com/youth-baseball-drills-speed-power/1893/','kenny','<p>We want to share with you some youth baseball drills that are going to help make your baseball players better athletes. Great athletes need quickness, explosiveness, and balance in order to maximize potential during the game. Improve Acceleration with Falling Runs For this drill, have your players stand tall with good posture. They should suck [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/youth-baseball-drills-speed-power/1893/\">How to Increase Your Players&#8217; Speed and Power</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Tutorials</a>.</p>',1348513282,'http://www.baseball-tutorials.com/?p=1893'),(1777,2,'Homework Hitting Drills: Practice These at Home','http://www.baseball-tutorials.com/homework-hitting-baseball-drills/1899/','kenny','<p>Today, we&#8217;re going to take you through a series of baseball drills that you can do in your backyard to practice hitting. These drills will assist you in developing bat speed, bat quickness, proper sequence of swing, and rhythm and timing. They can help to make any player a better hitter. These drills can be [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/homework-hitting-baseball-drills/1899/\">Homework Hitting Drills: Practice These at Home</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Tutorials</a>.</p>',1348681236,'http://www.baseball-tutorials.com/?p=1899'),(1778,2,'How to Work with Your Outfielders to Get Them Ready for the Game','http://www.baseball-tutorials.com/youth-baseball-outfield-fundamentals/1904/','kenny','<p>When you&#8217;re coaching youth baseball (and any type of baseball, actually) it&#8217;s important to spend adequate time on each position. Today we&#8217;re going to talk about a workout that&#8217;s ideal for your outfielders. So oftentimes as we work with young kids, we get the connotation with outfielders that the weaker players are put there for [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/youth-baseball-outfield-fundamentals/1904/\">How to Work with Your Outfielders to Get Them Ready for the Game</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Tutorials</a>.</p>',1349089735,'http://www.baseball-tutorials.com/?p=1904'),(1779,2,'3 Drills to Improve Your Players’ Hitting','http://www.baseball-tutorials.com/kids-baseball-drills-hitting/1915/','kenny','<p>The following kids baseball drills will help your players improve their bat speed, bat quickness, perception, power, and the sequence of their swing. They will also improve your players&#8217; game performance by practicing the techniques and skills that are a part of each drill. All great hitters have three things in common: good consistent practice [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/kids-baseball-drills-hitting/1915/\">3 Drills to Improve Your Players&#8217; Hitting</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Tutorials</a>.</p>',1349278190,'http://www.baseball-tutorials.com/?p=1915'),(1780,2,'How To Make The Ball Jump Off Your Bat','http://www.baseball-tutorials.com/baseball-hitting/1921/','kenny','<p>Today&#8217;s video covers a unique approach to baseball hitting mechanics that helps your players make better contact and increase their power. Click play to watch it now! Have you ever noticed that some hitters just find a way to get the ball to &#8220;jump&#8221; off their bat, and carry straight and true like a cruise [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/baseball-hitting/1921/\">How To Make The Ball Jump Off Your Bat</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Tutorials</a>.</p>',1349281599,'http://www.baseball-tutorials.com/?p=1921'),(1781,2,'Conditioning Workouts to Amp Up Your Players’ Skills','http://www.baseball-tutorials.com/kids-baseball-conditioning-workout/1928/','kenny','<p>Today we&#8217;re going to talk about a handful of conditioning workouts that are perfect for improving your kids baseball team&#8217;s skills. Backward Power Exercise The focus here is not speed or quickness; the focus is in really getting a good drive off either leg as you go backwards. We&#8217;re going to get into a defensive [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/kids-baseball-conditioning-workout/1928/\">Conditioning Workouts to Amp Up Your Players&#8217; Skills</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Tutorials</a>.</p>',1349722379,'http://www.baseball-tutorials.com/?p=1928'),(1782,2,'3 Effective Drills for Shortstops','http://www.baseball-tutorials.com/baseball-drills-shortstops/1936/','kenny','<p>Today, we&#8217;re going to cover some baseball drills that you can use to improve your shortstop&#8217;s skills. One of the most important things in being an infielder is being able to set your feet properly to be able to throw a strike to the target. Bases Drill Series The drill involves your player picking up [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/baseball-drills-shortstops/1936/\">3 Effective Drills for Shortstops</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Tutorials</a>.</p>',1349895745,'http://www.baseball-tutorials.com/?p=1936'),(1783,2,'4 Worthwhile Drills to Run with Your Pitchers','http://www.baseball-tutorials.com/worthwhile-baseball-pitching-drills/1942/','kenny','<p>Today, we&#8217;re going to talk about a variety of baseball pitching drills that can help your pitcher work on improving his pitch. One-Knee Drill, Bury the Shoulder With this drill, your pitcher will get down on one knee and start with his hands up, at the center of the body. This is what I refer [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/worthwhile-baseball-pitching-drills/1942/\">4 Worthwhile Drills to Run with Your Pitchers</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Tutorials</a>.</p>',1350329064,'http://www.baseball-tutorials.com/?p=1942'),(1784,2,'3 Hitting Situations to Run with Your Team','http://www.baseball-tutorials.com/baseball-practice-hitting-situations/1946/','kenny','<p>During baseball practice, one important thing to do (that&#8217;s often overlooked) is going over hitting situations with your team. During game time, having the knowledge of these situations that commonly occur can help your players score more runs. Execution – knowing when, where, and why to use these situations – is important to every team&#8217;s [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/baseball-practice-hitting-situations/1946/\">3 Hitting Situations to Run with Your Team</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Tutorials</a>.</p>',1350490467,'http://www.baseball-tutorials.com/?p=1946'),(1785,2,'Drills to Help Your Players Gain Explosive Speed and Body Control','http://www.baseball-tutorials.com/youth-baseball-drills-speed/1951/','kenny','<p>During today&#8217;s blog post, we&#8217;re going to go over a variety of youth baseball drills that will help your players improve their speed, balance, and body control. Linear Run and Stick Here we want to work on our balance and body control for change of direction. Start with linear runs by sticking and holding your [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/youth-baseball-drills-speed/1951/\">Drills to Help Your Players Gain Explosive Speed and Body Control</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Tutorials</a>.</p>',1350928370,'http://www.baseball-tutorials.com/?p=1951'),(1786,2,'The Correct Stance Leads to a Successful Swing (Part 1)','http://www.baseball-tutorials.com/baseball-coaching-stance-part1/1962/','kenny','<p>One of the most important things to focus on when focusing on baseball coaching is the swing itself. During today&#8217;s blog post, we&#8217;re going to talk about the first stage of a successful bat swing. The Stance We&#8217;ll go through the whole stance and we&#8217;ll talk about things I think are very critical for you [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/baseball-coaching-stance-part1/1962/\">The Correct Stance Leads to a Successful Swing (Part 1)</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Tutorials</a>.</p>',1351102423,'http://www.baseball-tutorials.com/?p=1962'),(1787,2,'The Correct Stance Leads to a Successful Swing (Part 2)','http://www.baseball-tutorials.com/kids-baseball-hitting-stance/1968/','kenny','<p>Last week, we talked a little bit about how to get your kids baseball players in the correct hitting stance (Part 1 can be found here). Today, we&#8217;re going to continue and wrap up the topic by providing you with some more tips about achieving the perfect hitting stance. Bending at the Waist is a [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/kids-baseball-hitting-stance/1968/\">The Correct Stance Leads to a Successful Swing (Part 2)</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Tutorials</a>.</p>',1351537160,'http://www.baseball-tutorials.com/?p=1968'),(1788,2,'4 Conditioning Drills to Improve Your Team’s Power and Speed','http://www.baseball-tutorials.com/conditioning-baseball-drills-power-speed/1985/','kenny','<p>Today, we&#8217;re going to talk about a variety of baseball drills that you can run with your team to improve your players&#8217; strength, quickness, and power. Let Go&#8217;s Drill For this drill, you&#8217;ll need a partner. Have one player hold on to his partner&#8217;s arms. The second player should start standing tall with good posture. [...]</p><p>The post <a href=\"http://www.baseball-tutorials.com/conditioning-baseball-drills-power-speed/1985/\">4 Conditioning Drills to Improve Your Team&#8217;s Power and Speed</a> appeared first on <a href=\"http://www.baseball-tutorials.com\">Baseball Tutorials</a>.</p>',1351710570,'http://www.baseball-tutorials.com/?p=1985');
