INSERT INTO `block_custom` VALUES (1,'<p>Thank to everyone who attended and supported The Comedy Night.</p>\r\nInfo <a href=\"mailto:coach@wellesleybaseball.com\">Coach Kane</a></p>','Comedy Night','full_html'),(2,'<p><span class=\"tagline\">Week of <?php echo date(\"m.d.y\"); ?></span>\r\n<br />BA: Jim Florence (.346)\r\n<br />HR: Jon F (2)\r\n<br />RBI: Jim R (12)\r\n<br />R: Jon F (12)\r\n<br />OBP: Rob R (.567)\r\n<br />OPS: Jon F (.786)</p>','Team Leaders','php_code'),(3,'\r\n<div class=\"block-content\">\r\n<!-- START EDITABLE AREA FOR CONTENT -->\r\n<p>We need a sponsor for this space.  The plan is to have local sponsors throughout our website.  We need businesses from Wellesley.  Please contact <a href=\"mailto:coach@wellesleybaseball.com\"> Coach Kane for more information.</a></p>\r\n<!-- END EDITABLE AREA FOR CONTENT -->\r\n</div>','Sponsors','full_html'),(4,'Wellesley High School \r\nAthletic Department\r\n50 Rice Street\r\nWellesley, MA 02481\r\np. (781) 446-6290\r\ne. coach@wellesleybaseball.com','Contact Us Block','filtered_html'),(5,'Praesent in nunc in ipsum malesuada laoreet. <a href=\"\">Vestibulum ante ipsum</a> primis in faucibus orci luctus et ultrices posuere cubilia Curae; Maecenas quis tortor augue, in pulvinar tortor. Quisque vel leo vitae nisi dapibus tristique.','User 6','filtered_html'),(6,'The Wellesley Raiders coaching staff strongly believes in responsible use of Social Media. Taking responsibility for our online actions enables us to accurately reflect our school, our fellow students, our teachers and coaches, and our families. We are a team, on and off the field.  <a href=\"http://wellesleybaseball.com/article/how-we-use-social-media-organization\">Learn more about how our coaching staff plans on implementing social media to communicate with you this year</a>.','User 7','filtered_html'),(7,'Wellesley High School would like to thank the following sponsors for their incredible generosity this year.  Their contributions help make our program possible.\r\n\r\n<img src=\"\">','Sponsorships','filtered_html'),(8,'<iframe width=\"290\" height=\"350\" frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"http://maps.google.com/maps?oe=utf-8&amp;client=firefox-a&amp;ie=UTF8&amp;cid=0,0,10980503902992751621&amp;fb=1&amp;hq=hunnewell+field&amp;hnear=0x89e381494b037bf1:0x2e02dee56381fb2b,Wellesley,+MA&amp;gl=us&amp;daddr=Wellesley,+Massachusetts&amp;geocode=0,42.30313,-71.282726&amp;ll=42.30313,-71.282726&amp;spn=0.006295,0.008512&amp;t=h&amp;iwloc=lyrftr:h,10980503902992751621,42.302964,-71.282226&amp;output=embed\"></iframe><br /><small><a href=\"http://maps.google.com/maps?oe=utf-8&amp;client=firefox-a&amp;ie=UTF8&amp;cid=0,0,10980503902992751621&amp;fb=1&amp;hq=hunnewell+field&amp;hnear=0x89e381494b037bf1:0x2e02dee56381fb2b,Wellesley,+MA&amp;gl=us&amp;daddr=Wellesley,+Massachusetts&amp;geocode=0,42.30313,-71.282726&amp;ll=42.30313,-71.282726&amp;spn=0.006295,0.008512&amp;t=h&amp;iwloc=lyrftr:h,10980503902992751621,42.302964,-71.282226&amp;source=embed\" style=\"color:#0000FF;text-align:left\">View Larger Map</a></small>\r\n','Directions','full_html'),(9,'<h4>Head Coach: Rob Kane</h4>\r\n<p>Rob Kane returns for his sixth season with the Raiders.  Under Kane, the Wellesley Raiders have reached the MIAA Tournament the last five seasons while going a combined 57-48.  One of Coach Kane\'s favorite moments as Coach was in 2007 when the Raiders shocked Plymouth South by scoring 7 runs in the bottom of the 7th inning with two outs to knock off the Panthers. Coach Kane was the JV and Freshmen coach at Newton North prior to his arrival in Wellesley. </p>\r\n\r\n<h4>Assistant Coach: Jim Everhart</h4>\r\n<p>Jim Everhart will be entering his second season as a varsity assistant.  Prior to joining the Varsity team, Coach Everhart was the head JV coach for two seasons.  Coach Everhart also spent one season at the helm of the 8th grade team.  Still an active player, Coach Everhart plays in a competive men\'s hardball league during the summer.  This year Coach Everhart will run the Boston Marathon. </p>\r\n\r\n<h4>Volunteer Assistant Coach: Rich Childs</h4>\r\n<p> Rich Childs joins the Varsity staff for his first season after serving as the Freshmen Boy\'s Basketball coach at Wellesley High School.  A former standout at Salem State as a catcher, Coach Childs will work with catchers Jack Porter and Matt Pini throughout season.\r\n\r\n<h4>Volunteer Assistant Coach: Paul Donato</h4>\r\n<p> Paul Donato will be entering his third season as a member of the baseball staff.  Coach Donato also is the Varsity Hockey Coach at Wellesley High School.  Coach Donato graduated from Babson where he later served as Head Hockey and Baseball Coach.  His 1984 Hockey team won the NCAA Division 3 National Championship.','Coaching Staff: Varsity','full_html'),(10,'<?php if (function_exists(\'twitter_pull_render\')) { print twitter_pull_render(\'@raider_baseball\', \'Twitter Updates\', 5); } ?>\r\n','Latest Tweets','php_code'),(11,'<span class=\"legend varsity\">Varsity</span>\r\n<span class=\"legend jv\">Junior Varsity</span>\r\n<span class=\"legend freshman\">Freshman</span>\r\n<span class=\"legend eighthgrade\">8th Grade</span>','Legend - Games','full_html'),(12,'<p>If you are still looking to purchase team gear check your email.  Limited quantities and sizes of Under Armour shirts are available.</p>','Save the Date','full_html'),(13,'<table id=\"standings\">\r\n<thead>\r\n</thead>\r\n<th>Herget Division</th><th>W</th><th>L</th>\r\n<tr><td>Walpole</td><td>14</td><td>2</td></tr>\r\n<tr><td>Norwood</td><td>12</td><td>4</td></tr>\r\n<tr><td>Wellesley</td><td>9</td><td>7</td></tr>\r\n<tr><td>Natick</td><td>5</td><td>11</td></tr>\r\n<tr><td>Milton</td><td>4</td><td>12</td></tr>\r\n<tr><td>Dedham</td><td>3</td><td>13</td></tr>\r\n\r\n\r\n<th>Carey Division</th><th>W</th><th>L</th>\r\n<tr><td>Braintree</td><td>11</td><td>5</td></tr>\r\n<tr><td>Framingham</td><td>10</td><td>6</td></tr>\r\n<tr><td>Brookline</td><td>9</td><td>7</td></tr>\r\n<tr><td>Newton North</td><td>9</td><td>7</td></tr>\r\n<tr><td>Weymouth</td><td>8</td><td>8</td></tr>\r\n<tr><td>Needham</td><td>1</td><td>15</td></tr>\r\n\r\n</table>\r\n','Bay State Conference Standings','full_html');
