INSERT INTO `field_data_body` VALUES ('node','page',0,7,7,'und',0,'The 2012 Junior Varsity season preview will be located here in the near future.\r\n\r\nGame Schedule is the same as varsity with the exclusion of the April Break games.\r\n\r\n','','filtered_html'),('node','page',0,8,8,'und',0,'Drew Kelton returns for his 10th season as the Freshmen Baseball Coach.  Coach Kelton played baseball and football at Springfield College.  A graduate of Wellesley High School (\'87) Coach Kelton has been instrumental in the continued development of all players in the program.  Away from the field, Coach enjoys playing golf.  Drew and his wife Michaela have two children Olivia and Nathan.  \r\n\r\nPlease check back for more information on the team throughout the season.  Freshmen coordinators will update site with upcoming games, events, and social events.  ','','filtered_html'),('node','page',0,440,440,'und',0,'Text about the Wellesley Raiders Varsity squad.','','filtered_html'),('node','page',0,508,508,'und',0,'We are currently exploring options to sell Wellesley Raiders hats, sweatshirts, and other baseball-related items.  Stay tuned to Twitter, Facebook, and our website for more details as they emerge!','','filtered_html'),('node','page',0,509,509,'und',0,'Former Wellesley Raider (\'04) Dan Sorrell returns for his 4th season at the helm of the 8th grade team.  Dan enjoys history and trivia while listening to his favorite 80\'s music.  Some of Dan\'s favorite teams include: Red Sox, Dayton Flyers, Patriots, Bruins, and Celtics.\r\n\r\nAssisting Coach Sorrell is another former Raider, Charlie Doherty.  This will be the fourth season Charlie and Dan have coached the 8th squad together.  Coach Doherty enjoys watching college and pro hockey.','','filtered_html'),('node','article',0,515,515,'und',0,'The Wellesley Raiders coaching staff strongly believes in responsible use of Social Media. Everything we publish (website articles, Facebook and Twitter posts, etc) is instantly available, and in many cases, irreversible. Taking responsibility for our online actions enables us to accurately reflect our school, our fellow students, our teachers and coaches, and our families. We are a team, on and off the field. Learn more about how our coaching staff plans on implementing social media to communicate with you this year.\r\n\r\nFacebook:\r\nWill become a launching off point for Alumni.\r\n\r\nTwitter:\r\nShort updates that will occasionally link back to this site for more information (game updates, weather advisories, game cancellations, etc).\r\n\r\nFlickr:\r\nGame photos\r\n\r\nYouTube:\r\nVideo from games and events','','filtered_html'),('node','webform',0,522,522,'und',0,'Contact the staff at Wellesley High School.','','filtered_html'),('node','events',0,523,523,'und',0,'Fundraiser #1','','filtered_html'),('node','page',0,524,524,'und',0,'Varsity: \r\nHead Coach: Rob Kane (6th year, University of Scranton)\r\nAssistant Coach: Jim Everhart (2nd year, St. Michaels)\r\nAssistant Coach: Paul Donato (3rd year, Babson)\r\nAssistant Coach: Rich Childs (1st year, Salem State)\r\n\r\nJV:\r\nMike Coppinger (2nd year, Merrimack)\r\n\r\nFreshman:\r\nDrew Kelton (10th year, Springfield College)\r\nMatt Andrews (3rd year)\r\n\r\n8th Grade:\r\nDan Sorrell (4th year, Dayton)\r\nCharlie Doherty (4th year)','','filtered_html'),('node','page',0,526,526,'und',0,'The Raiders look to kick off their season on March 19th with tryouts. ','','filtered_html'),('node','article',0,530,530,'und',0,'The Wellesley Raiders baseball team will face another challenging schedule in 2012.  The Raiders will play 15 games against teams that reached the MIAA Tournament a year ago.  The Raiders will host 2011 tournament teams from Dedham, Walpole, Medfield, Norwood, and Milton.  Wellesley will take to the road to play Xaverian, Dedham, Needham, Walpole, Medfield, Catholic Memorial, Norwood, Milton, Braintree, and Newton North.  \r\n\r\nWith practice scheduled to start Monday, March 19 the Raiders have two weeks to get ready for opening day.  Wellesley will begin the season on the road at Xaverian (4pm) on Tuesday, April 3.  The next day the Framingham Flyers come to Sprague Field to open up Bay State Conference play.  First pitch is scheduled for 3:45pm.\r\n\r\nWellesley plays two of its next three games versus Bay State opponents on the road.  After hosting Dedham on Monday, April 9 at Sprague Field the Raiders hit the road on Wednesday, April 11 to play the Needham Rockets.  A game at Walpole on Friday, April 13 concludes the first full week of Bay State Conference games.  All three games are scheduled for 3:45pm starts.\r\n\r\nOver April break the Raiders face two prominent baseball powers in Medfield and Catholic Memorial.  The Medfield game is scheduled for Tues, April 17 (11am) at Curt Schilling Field in Medfield.  Two days later the Raiders travel to West Roxbury to face Catholic Memorial for a 11am first pitch.\r\n\r\n\"The Bay State Conference is full of good baseball teams.  Eight teams qualified a year ago and it wouldn\'t surprise me to see that number again this year.  Our non league schedule is just as tough.  The schedule itself will hopefully prepare us for the MIAA Division 2 Tournament,\" head coach Rob Kane said.\r\n\r\nThe Bay State Conference schedule gets in full swing beginning Monday, April 23 when the Raiders host Weymouth at 3:45pm.  The Raiders then travel to Norwood on Wednesday, April 25 (4pm) followed by a home game on Friday, April 27 vs. Milton at Sprague (3:45pm).\r\n\r\nThe rivalry with Natick is renewed on Monday, April 30 when the Raiders host Natick for a key Bay State Herget Division matchup.  \"As a program we always look forward to playing Natick.  It seems every game comes down to one run,\" Kane added. The Raiders then play Bay State Carey opponent Brookline on Wednesday, May 2 at Sprague (4pm).  To wrap up the week the Raiders head to Dedham on Friday, May 4 for a Bay State Herget game which will likely begin at 7pm. \r\n\r\nThe Raiders open a short week beginning on Monday, May 7 when they travel to play the Wamps of Braintree at 4pm.  Wellesley will host 2011 Bay State Herget division winner Walpole on Wednesday, May 9 at Sprague.  The next day the Raiders are back on the road to play non league opponent Brighton at Rogers Field (4pm).\r\n\r\nThe final two weeks of the season include four Bay State Conference games along with two non league games.  On Monday, May 14 the Newton North Tigers will play host to the Raiders at Albermarle Park.  Norwood makes their only appearance in Wellesley on Wednesday, May 16.  The Raiders will host a special Saturday noon game on May 19 vs. Brighton. \"We thought that a Saturday game in May would be a great opportunity for Little League and Senior League teams to come watch us play.  In the past this has been a great turnout.  We hope that will continue this year.\" Kane said.\r\n\r\nThe final week of the season begins on Monday, May 21 when the Raiders head to Milton for a 4pm start.  The Raiders then head down the road to Natick for a special Coaches vs. Cancer game scheduled for 7pm.  More information regarding this game will be released as the game approaches. The Raiders wrap up the regular season on Friday, May 25 at home versus non league opponent Medfield (4pm). \r\n\r\n\r\nPlease visit our Twitter page (Raider_Baseball) for game recaps throughout the season.\r\n','','filtered_html'),('node','article',0,535,535,'und',0,'Over the course of the next few weeks the website will be updated with game schedules, diamond club information, plus much more.  Be sure to follow our Twitter feed (raider_baseball) for announcements relative to Wellesley Baseball.  If you have any questions please contact Coach Kane.','','filtered_html'),('node','page',0,544,544,'und',0,'<p>Are you thinking of becoming a sponsor of the Wellesley Raiders Baseball Program?  Here are a few of the perks:</p>\r\n<ul>\r\n<li>Your business will be featured in ads splashed across our webiste</li>\r\n<li>If you give us the address information of your loaction(s), we will add it to our directions/maps to show our family, friends, co-workers and other sponsors where you are located.  Odds are that they\'ll have errands to run either before or after the game - why not show them (a) that you\'re helping make our program possible and (b) where you are located.</li>\r\n<li>Membership in The Diamond Club, our exclusive program.</li>\r\n</ul>\r\n','','full_html'),('node','page',0,546,546,'und',0,'For directions to our field please click either the Wellesley Raiders logo or the \"P\" symbol on the map.\r\n\r\n<iframe width=\"960\" height=\"450\" frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"http://maps.google.com/maps/ms?msa=0&amp;msid=209181647909567900280.0004b9e65f0c74b0d4eb3&amp;hl=en&amp;ie=UTF8&amp;t=h&amp;ll=42.304515,-71.293974&amp;spn=0.003571,0.010289&amp;z=17&amp;output=embed\"></iframe><br /><small>View <a href=\"http://maps.google.com/maps/ms?msa=0&amp;msid=209181647909567900280.0004b9e65f0c74b0d4eb3&amp;hl=en&amp;ie=UTF8&amp;t=h&amp;ll=42.304515,-71.293974&amp;spn=0.003571,0.010289&amp;z=17&amp;source=embed\" style=\"color:#0000FF;text-align:left\">Sprague Field - Wellesley Raiders</a> in a larger map</small>','','full_html'),('node','article',0,552,552,'und',0,'Please think about making a donation as Coach works toward his goal.\r\n\r\nOn Monday, April 16 Coach Everhart will run the marathon for the Friends of\r\nWellesley METCO Inc. (FWMI). As many of you know, this charitable organization is comprised\r\nof Wellesley community members who support the Wellesley METCO students. FWMI\r\nprovides a wide range of support to METCO students such as transportation, after-school\r\ncare, scholarships, tutoring and breakfasts. Recently, like many organizations, FWMI’s funding\r\nhas been cut and some services are no longer available. This year the town of Wellesley and\r\nthe Boston Athletic Association (BAA) have awarded FWMI 10 bib numbers for the Boston\r\nMarathon. Coach Everhart received one number and has agreed to raise $4,000 for the organization.\r\n\r\n\"I personally believe in this organization and am passionate about running to support the METCO\r\nstudents. This is my first marathon, and the main reason I am running is to help FWMI.\r\nPlease consider contributing to this excellent organization and to help me reach my fundraising\r\ngoal,\" said Coach Everhart.\r\n\r\nTo help Coach Everhart as he works to meet his goal of raising $4000 visit his fundraising page here: \r\nhttp://www.firstgiving.com/fundraiser/jimeverhart/friendsofwellesleymetco\r\n\r\nThank you to everyone for their support and let’s have a great 2012 season.','','filtered_html'),('node','article',0,560,560,'und',0,'Junior shortstop Kevin Superko laced an inside the park homerun in the top of the 8th inning as the Raiders beat Xaverian 6-3 Tuesday, April 3rd.  Sophomore Conor Russell pitched a strong 6 2/3 innings while striking out five and walking none.  Junior Brian McMahon picked up the win in relief.  Freshmen center fielder Peter Stabnick tied the game with an RBI single in the top of the 7th with two outs scoring senior Drew Buzzell.  Nir Liebenthal, Soph, and John Picking, Jr, each added a hit for the Raiders.  The Raiders host Framingham on Wednesday, April 4 to open the Bay State Conference schedule.  Senior LHP Tim Superko is expected to start.\r\n\r\nWestwood, MA.','','filtered_html'),('node','article',0,561,561,'und',0,'The Wellesley Raiders (1-0) opened Bay State Conference play with a 3-2 victory over Carey foe Framingham (0-1). Senior LHP Tim Superko (1-0) dazzled the Flyers over 6 innings by striking out 14 and allowing only 3 hits.  At the plate, Superko was 2-3 with two triples and two runs scored.  Freshmen Center Fielder Peter Stabnick had two hits including an RBI single in the 1st.  Junior Designated Hitter Will Adams registered his first varsity hit and added another as the Raiders improved to 2-0 on the season.  Dedham heads to town on Monday, April 9 for a 3:45pm start at Sprague.\r\n\r\n','','filtered_html'),('node','article',0,562,562,'und',0,'Coach Kelton and his Freshmen squad beat Framingham 9-4 Thursday at Honeywell Field. Jack Dolan allowed one hit while striking out 10 Flyers to pickup the victory.  Matt Eldridge added two hits and four RBI\'s at the plate.  Davis Wall also had multiple hits while Ghiho Ghim and Dolan each had a hit.  The Raiders return to the diamond on Thurs, April 12 vs. Dedham. \r\n\r\nWellesley, MA.','','filtered_html'),('node','article',0,584,584,'und',0,'The Raiders scored in every inning except one as they went on to beat Dedham 10-0 at Sprague Field Monday.  Tim Superko (Sr), Jack Porter (Soph), Brian McMahon (Jr), and Peter Stabnick (Fr) each had two hits apieice.  Porter and McMahon each knocked in two runs.  Conor Russell (Soph) pitched six strong innings to pickup the win.  Russell added 6 strikeouts while only allowing 2 hits.  George Docktor (Jr) made his first varsity appearance on the mound and struck out two Marauders.  The Raiders travel to Needham for a Bay State Conference game on Wednesday, April 11.  Game time is 4pm.\r\n\r\n','','filtered_html'),('node','article',0,585,585,'und',0,'Conor Himstead pitched six innings to pickup the win vs. Dedham on Monday at Honeywell Field.  Brian Creonte and Ghiho Gihm were strong offensively as the Raiders improved to 2-0 on the season.  The team returns to the field Thurs, April 12 vs. Needham.','','filtered_html'),('node','article',0,586,586,'und',0,'The Raiders scored double digit runs for the second consecutive game as they beat Needham 10-0 Wednesday. Tim Superko (Sr) opened the scoring with a 3rd inning RBI ground out scoring Nir Liebenthal (Jr).  The Raiders added nine more runs over the final 5 innings including five in the top of seventh.  The game was called after 8 innings.  Superko picked up his second win of the season going 6 innings and striking out 11.  He allowed only 2 hits.  It was the second consecutive game the Raiders only allowed 2 hits.  John Picking (Jr), Superko, and Brian McMahon (Jr) each had three hits.  Drew Buzzell (SR) added a pair of hits as the Raiders improved to 3-0 on the season. ','','filtered_html'),('node','article',0,587,587,'und',0,'In a battle of two Bay State Herget undefeated teams, Walpole beat Wellesley 9-4 at Bird Middle School Friday.  Peter Stabnick (So), Kevin Superko (Jr), and Tim Superko (Sr) each had two hits apiece.  Over April Break the Raiders travel to Medfield on Tues, April 17 and to Catholic Memorial on Friday, April 20th.  Both games start at 11am.  ','','filtered_html'),('node','article',0,589,589,'und',0,'Brian McMahon (Jr) pitched 2 1/3 innings of scoreless relief while striking out five in non league game vs. Medfield.\r\n\r\n\r\nMcMahon allowed one hit to pick up his second victory of the season.  McMahon relieved Tim Superko (Sr) with two outs in the fifth inning and runners on 1st and 2nd.  Wellesley lead 6-0 after two innings.  The Warriors answered with 6 runs in the fifth to tie the game.  Superko lead off the 6th with a single up the middle.  He then advanced to 2nd on a wild pitch.  Jack Porter (Soph) ripped a ground rule double to score Superko which turned out to be the winning run.  McMahon, Tim Superko, and Kevin Superko each scored two runs.  The Raiders return to the diamond on Friday when they visit Catholic Memorial for a 11am first pitch.','','filtered_html'),('node','article',0,595,595,'und',0,'\r\n\r\n\r\nThe Raiders battled Milton in windy conditions at Sprague Field Friday for a 4-2 victory in Bay State Conference action.  Tim Superko picked up the win while striking out 9 over five innings.  Kevin Superko pitched the final four innings to earn the save.  K. Superko lead the offense with 2 hits.  Will Adams added a key two run single and Cos Ferrante knocked in the final run with a two out single in the bottom of the 8th inning.  Wellesley returns to the diamond Saturday vs. Weymouth for a 2pm start.','','filtered_html'),('node','article',0,601,601,'und',0,'Raiders continue winning streak with a sweep of Brighton.\r\n\r\nThe second half of a home and home vs. Brighton was played at Sprague on Saturday, May 23.  Sophomore Owen Wohl made his first varsity start and lead the Raiders to a 6-4 victory.  After surrendering a two run home run in the 1st, Wohl pitched four strong innings against a very good Brighton team.  Wohl struck out 3 while allowing 5 hits.  Junior Brian McMahon notched his third save of the season with three solid innings of relief.  Offensively, Freshmen Peter Stabnick had three hits including a triple.  He also added a RBI.  The Raiders (10-7) clinched a postseason victory for the sixth consecutive season.\r\n\r\nAfter a slow start, the Raiders won 4-1 at Rogers Field on Friday, May 22. Avery Brooks made his first start of the season and picked up the win while striking out three and allowing five hits.  Junior Kevin Superko picked up the save.  At the plate, Brooks and Junior Will Adams each laced triples, while Junior John Picking and Freshmen Peter Stabnick added doubles.   With the win the Raiders improved to 9-7 on the season.  The home and home series continues Saturday, May 19 at Sprague.  First pitch at Noon.\r\n\r\nOn Thursday, the Raiders traveled to Newton North to makeup a game from earlier in the week.  Senior Tim Superko pitched seven strong scoreless innings while striking out seven and allowing four hits as the Raiders won 4-0.  Junior Brian McMahon relieved Superko to start the 8th inning and notched the save.  Peter Stabnick added two RBIs and McMahon also had a RBI for the Raiders who improved to 7-7 in the Bay State Conference.  ','','filtered_html'),('node','article',0,602,602,'und',0,'\r\n\r\nWellesley scored four runs in the top of first including a three run home by Senior Avery Brooks as the Raiders went on to win 6-0 over Milton.  Wellesley had the bats going early as John Picking lead off the game with a single up the middle.  Senior Tim Superko hit an opposite field single to put runners on first and second.  Junior Kevin Superko then laced a line drive to the center for a RBI single to put the Raiders up 1-0.  Brooks who recently returned from a back injury launched 1-2 pitch deep to Center Field for his first homerun of the season.  Kevin Superko picked up the win going six strong innings and striking out five.  Tim Superko added a RBI in the seventh inning with a sacrifice fly.  The Raiders (11-7, 8-7) conclude the Bay State Conference schedule with a Herget matchup vs. Natick on Wed, May 23 at 7pm in a Coaches vs. Cancer game.','','filtered_html'),('node','article',0,603,603,'und',0,'\r\n\r\nWellesley will play at Natick on Wed, May 23 in a Coaches vs. Cancer Game.  Wellesley players will wear pink socks and Natick players will sport pink shoelaces and wristbands.  All proceeds from the game will be donated to the American Cancer Society.  Come and support the Raiders tonight at 7pm.','','filtered_html'),('node','article',0,604,604,'und',0,'\r\nStabnick with clutch hit to score Kevin Superko.\r\n\r\nFreshmen Peter Stabnick ripped a two out RBI single to score Junior Kevin Superko with the go ahead run in the top of the 10th as the Raiders held on for a 3-2 win.  Kevin Superko reached based by error with two outs.  Superko then demonstrated his speed by stealing second base.  Two pitches later Superko scored on a hard hit ball to right field by Stabnick.  \r\n\r\nAfter falling behind 2-0, the Raiders answered with a run in the 4th inning with a RBI groundout by Will Adams to score Junior Brian McMahon.  In the top of the eighth Senior Tim Superko reached base with a single to left.  Kevin Superko stepped to the plate and laced an opposite field triple to score his brother, Tim, to tie the game.  \r\n\r\nStarter Tim Superko registered 11k\'s over seven innings while allowing four hits.  McMahon picked up the win in relief going the final three innings and striking out five.  Wellesley (12-7, 9-7) concludes the regular season Friday against Medfield.  The game will be played at Babson starting at 4pm.  ','','filtered_html'),('node','article',0,608,608,'und',0,'\r\nAfter waiting nearly five days to play the Raiders lost 1-0 to Sharon at Sprague.\r\n\r\n\r\nSenior captain Tim Superko struck out eleven and only allowed one hit.  Sharon scored the only run of the game in the 3rd inning on a two hit by Jake Fishman. Offensively the Raiders had five hits versus Fishman.  The Raiders finished the 2012 season with a 13-8 record.  ','','filtered_html');
