INSERT INTO `field_data_field_interests` VALUES ('node','players',0,498,498,'und',0,'Known for his hockey talents Pick played LF and 3b in 2011...Can be seen rollerblading around town...Enjoys to workout and go to the beach in his free time...Favorite subject: Math...Favorite team: Boston Bruins.',NULL),('node','players',0,504,504,'und',0,'Two sport athlete...QB on the football team...Favorite teams: Red Sox and Patriots...Favorite subject: Math...enjoys running and working out in his free time...will attend Stonehill in the fall.',NULL),('node','players',0,517,517,'und',0,'Football, Indoor Track, Notre Dame Football and UCF Baseball',NULL),('node','players',0,551,551,'und',0,'Grew up and attended school in Winnipeg prior to his arrival in Wellesley this past August...A true follower of all professional sports, Nir ranks the Milwaukee Brewers as his favorite team in MLB...Favorite subject: Science...Plays on Wellesley Hoops Team.',NULL),('node','players',0,564,564,'und',0,'Enjoys going to the beach, rollerblading, and playing hockey.',NULL),('node','players',0,565,565,'und',0,'Named Honorable Mention Bay State All Star in 2011...Plays on the 18u New England Ruffnecks...Enjoys playing the piano, swimming, cheering for the Sox and Bruins, and studying Spanish...Tim will attend Philips Andover in the fall as a post graduate student.',NULL),('node','players',0,566,566,'und',0,'Played on Varsity team as a freshmen backing up his brother, Stu, behind the plate....Member of the New England Ruffnecks 16u team...Favorite MLB Team: Cubs....Favorite Subject: English.',NULL),('node','players',0,568,568,'und',0,'Pond hockey player in the winter...enjoys watching Boston Bruins and Red Sox on NESN...Favorite subject: Math...Member of New England Ruffnecks 16u team.',NULL),('node','players',0,569,569,'und',0,'Junior class president...Member of Varsity Golf Team...Favorite Team: Red Sox...Favorite Subject: English...Enjoys to read and get involved in community events...Brother Will played on Varsity baseball team 2006-2007. ',NULL),('node','players',0,570,570,'und',0,'Played Freshmen Basketball...involved in Wellesley High School Store...Favorite teacher: Mr. Hatch...Member of New England Ruffnecks Baseball Program.',NULL),('node','players',0,571,571,'und',0,'First year at Wellesley...Born and raised in Winnipeg...Favorite MLB Team: Milwaukee Brewers...Member of Wellesley Basketball team.',NULL),('node','players',0,572,572,'und',0,'Varsity Football player...Enjoys fishing in the summer...Favorite Team: Boston Bruins...Favorite Subject: Social Studies...Played RF in 2011 tournament games.',NULL),('node','players',0,573,573,'und',0,'Born in Pittsburgh, PA....Pirates fan...Enjoys watching all professional sports...Considers Math his favorite subject...and is a member of the football and basketball teams at WHS.',NULL),('node','players',0,576,576,'und',0,'Played on Varsity Football Team...enjoys to workout and run...favorite subject: Math...avid follower of the Patriots and Red Sox...Will attend Stonehill in the fall.',NULL),('node','players',0,577,577,'und',0,'Big fan of the North Carolina Tarheels...Named Hoops Captain for 2012-13 season...Favorite subject English with a concentration in poetry.',NULL),('node','players',0,578,578,'und',0,'Running back on the football team...sprinter on the indoor track team...Favorite MLB team: Red Sox...Favorite Subject: History...Big Notre Dame Fan...Member of Nokona 16u baseball team.',NULL),('node','players',0,579,579,'und',0,'Enjoys the beach and spending time with friends...Favorite Teacher: Mr. Hatch...Favorite Subject: Business...Red Sox Fan...Played on WHS Varsity Basketball Team...will attend Elon in the fall to pursue a degree in business....4 year member of WHS Baseball team.',NULL),('node','players',0,580,580,'und',0,'Member of Football and Wrestling teams...enjoys watching the Patriots, playing frisbee and listening to music...during the summer Will is a lifeguard...favorite subject: English.',NULL),('node','players',0,581,581,'und',0,'Second season on Varsity baseball team...also a member of Varsity Hockey team where he plays left wing...will be used as a reliever in addition to playing OF...Favorite Team: Boston Bruins.',NULL);
