INSERT INTO `search_dataset` VALUES (7,'node',' junior varsity jv  the 2012 junior varsity season preview will be located here in the near future game schedule is the same as varsity with the exclusion of the april break games  ',0),(8,'node',' freshmen preview drew kelton returns for his 10th season as the freshmen baseball coach coach kelton played baseball and football at springfield college a graduate of wellesley high school 87 coach kelton has been instrumental in the continued development of all players in the program away from the field coach enjoys playing golf drew and his wife michaela have two children olivia and nathan please check back for more information on the team throughout the season freshmen coordinators will update site with upcoming games events and social events  ',0),(413,'node',' player data feed ',0),(440,'node',' varsity text about the wellesley raiders varsity squad  ',0),(490,'node',' drew buzzell drew buzzell 5 8 165 senior 2012 varsity              1200 l r   lf rf lf  ',0),(491,'node',' george doctor george doctor 6 2 190 junior 2013 varsity              1500 r r   1b lf  ',0),(492,'node',' avery brooks avery brooks 6 3 200 senior 2012 varsity              1800 r r   p 1b lf cf rf p  ',0),(493,'node',' brian mcmahon brian mcmahon 5 9 161 junior 2013 varsity              2200 r r   p 2b 2b  ',0),(496,'node',' ned holmes ned holmes 5 9 187 junior varsity varsity              600 r l   1b 2b  ',0),(497,'node',' jack porter jack porter 5 10 167 sophomore 2014 varsity              500 r r   c c  ',0),(498,'node',' john picking john picking 5 9 170 junior 2013 varsity              1200 l r known for his hockey talents pick played lf and 3b in 2011 can be seen rollerblading around town enjoys to workout and go to the beach in his free time favorite subject math favorite team boston bruins   3b 3b  ',0),(499,'node',' tim superko tim superko 6  175 senior 2012 varsity              900 l l   p 1b lf rf p  ',0),(500,'node',' kevin superko kevin superko 5 11 160 junior 2013 varsity              1100 r r   p ss ss  ',0),(504,'node',' matt pini matt pini 5 10 185 senior 2012 varsity              2300 r r two sport athlete qb on the football team favorite teams red sox and patriots favorite subject math enjoys running and working out in his free time will attend stonehill in the fall   c c  ',0),(508,'node',' gear we are currently exploring options to sell wellesley raiders hats sweatshirts and other baseballrelated items stay tuned to twitter facebook and our website for more details as they emerge  ',0),(509,'node',' 8th grade coaches former wellesley raider 4 dan sorrell returns for his 4th season at the helm of the 8th grade team dan enjoys history and trivia while listening to his favorite 80 s music some of dan s favorite teams include red sox dayton flyers patriots bruins and celtics assisting coach sorrell is another former raider charlie doherty this will be the fourth season charlie and dan have coached the 8th squad together coach doherty enjoys watching college and pro hockey  ',0),(515,'node',' how we use social media as an organization the wellesley raiders coaching staff strongly believes in responsible use of social media everything we publish website articles facebook and twitter posts etc is instantly available and in many cases irreversible taking responsibility for our online actions enables us to accurately reflect our school our fellow students our teachers and coaches and our families we are a team on and off the field learn more about how our coaching staff plans on implementing social media to communicate with you this year facebook will become a launching off point for alumni twitter short updates that will occasionally link back to this site for more information game updates weather advisories game cancellations etc flickr game photos youtube video from games and events varsity junior varsity freshman 8th grade ',0),(516,'node','    256 97 2 127 30 8 111 94 171 333 358 691 75 275 669  ',0),(517,'node',' conor russell conor russell 6  160 sophomore 2014 varsity              400 r r football indoor track notre dame football and ucf baseball   p p  ',0),(522,'node',' contact us contact the staff at wellesley high school name your full name phone your phone number in the form 617xxxxxxx email your email address questions comments your questions or comments  ',0),(523,'node',' fundraiser fundraiser 1 sunday february 19 2012 500pm fundraisers ',0),(524,'node',' teams and coaching staff varsity head coach rob kane 6th year university of scranton assistant coach jim everhart 2nd year st michaels assistant coach paul donato 3rd year babson assistant coach rich childs 1st year salem state jv mike coppinger 2nd year merrimack freshman drew kelton 10th year springfield college matt andrews 3rd year 8th grade dan sorrell 4th year dayton charlie doherty 4th year  ',0),(526,'node',' about the raiders look to kick off their season on march 19th with tryouts  ',0),(527,'node',' hunnewell field brook path wellesley ma 2481 see map  google maps ',0),(530,'node',' 2012 schedule the wellesley raiders baseball team will face another challenging schedule in 2012 the raiders will play 15 games against teams that reached the miaa tournament a year ago the raiders will host 2011 tournament teams from dedham walpole medfield norwood and milton wellesley will take to the road to play xaverian dedham needham walpole medfield catholic memorial norwood milton braintree and newton north with practice scheduled to start monday march 19 the raiders have two weeks to get ready for opening day wellesley will begin the season on the road at xaverian 4pm on tuesday april 3 the next day the framingham flyers come to sprague field to open up bay state conference play first pitch is scheduled for 345pm wellesley plays two of its next three games versus bay state opponents on the road after hosting dedham on monday april 9 at sprague field the raiders hit the road on wednesday april 11 to play the needham rockets a game at walpole on friday april 13 concludes the first full week of bay state conference games all three games are scheduled for 345pm starts over april break the raiders face two prominent baseball powers in medfield and catholic memorial the medfield game is scheduled for tues april 17 11am at curt schilling field in medfield two days later the raiders travel to west roxbury to face catholic memorial for a 11am first pitch the bay state conference is full of good baseball teams eight teams qualified a year ago and it wouldn t surprise me to see that number again this year our non league schedule is just as tough the schedule itself will hopefully prepare us for the miaa division 2 tournament head coach rob kane said the bay state conference schedule gets in full swing beginning monday april 23 when the raiders host weymouth at 345pm the raiders then travel to norwood on wednesday april 25 4pm followed by a home game on friday april 27 vs milton at sprague 345pm the rivalry with natick is renewed on monday april 30 when the raiders host natick for a key bay state herget division matchup as a program we always look forward to playing natick it seems every game comes down to one run kane added the raiders then play bay state carey opponent brookline on wednesday may 2 at sprague 4pm to wrap up the week the raiders head to dedham on friday may 4 for a bay state herget game which will likely begin at 7pm the raiders open a short week beginning on monday may 7 when they travel to play the wamps of braintree at 4pm wellesley will host 2011 bay state herget division winner walpole on wednesday may 9 at sprague the next day the raiders are back on the road to play non league opponent brighton at rogers field 4pm the final two weeks of the season include four bay state conference games along with two non league games on monday may 14 the newton north tigers will play host to the raiders at albermarle park norwood makes their only appearance in wellesley on wednesday may 16 the raiders will host a special saturday noon game on may 19 vs brighton we thought that a saturday game in may would be a great opportunity for little league and senior league teams to come watch us play in the past this has been a great turnout we hope that will continue this year kane said the final week of the season begins on monday may 21 when the raiders head to milton for a 4pm start the raiders then head down the road to natick for a special coaches vs cancer game scheduled for 7pm more information regarding this game will be released as the game approaches the raiders wrap up the regular season on friday may 25 at home versus non league opponent medfield 4pm please visit our twitter page raiderbaseball for game recaps throughout the season featured varsity game recap ',0),(535,'node',' site updates over the course of the next few weeks the website will be updated with game schedules diamond club information plus much more be sure to follow our twitter feed raiderbaseball for announcements relative to wellesley baseball if you have any questions please contact coach kane  ',0),(542,'node',' dunkin donuts   ',0),(543,'node',' xaverian away  away tuesday april 3 2012 300pm varsity junior varsity xaverian  ',0),(544,'node',' sponsor information are you thinking of becoming a sponsor of the wellesley raiders baseball program here are a few of the perks your business will be featured in ads splashed across our webiste if you give us the address information of your loaction s we will add it to our directions maps to show our family friends coworkers and other sponsors where you are located odds are that they ll have errands to run either before or after the game why not show them a that you re helping make our program possible and b where you are located membership in the diamond club our exclusive program  ',0),(545,'node','  home  home wednesday april 4 2012 245pm varsity junior varsity ',0),(546,'node',' directions to sprague fi